  \"detroit-lakes-wetland-management-district-annual-narrative-report-calendar-year-1994\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Detroit
  Lakes Wetland Management District summarizes refuge activities during the 1994 calendar
  year.  The report begins with a summary of the yearu2019s highlights and climatic
  conditions.  Land acquisition - including fee titles and easements topics are also
  covered.  The report includes a planning section which discusses refuge management
  plans, compliance projects, and research.  Refuge administration is outlined; information
  about personnel, refuge programs, funding and safety is given.  Habitat management
  is also covered.  Subjects include croplands, grasslands, fire management, and private
  lands.  The wildlife section of the report discusses endangered or threatened species,
  migratory birds, game mammals, banding, and animal control.  The public uses of
  the refuge described in this report include interpretive programs, hunting, wildlife
  observation, and law enforcement.  The equipment and facilities section of the report
  provides information about new construction, maintenance, and energy conservation.
  \ Items of interest are provided at the end\",\n\t\"license_title\": \"License Not
